show_appropriate_help (){
   #If using the default kit name, display installation pre-help
   if [[ "$MNAM" =~ htk.sh--[0-9]+.[0-9]+.[0-9]+--[0-9]{14} ]] ; then
      show_pre_help
      return 0
   fi
   echo flag @ is $@
   echo flag 0 is $0
   echo flag 2 is $2
   if [ $# -gt 1 ] ; then
      less -p $2 $DOCDIR/usage.txt
   elif [ $# -eq 1 ] ; then
      if [ ! -e  $DOCDIR/usage.txt ] ; then
         show_pre_help
      else
         less -p $MNAM $DOCDIR/usage.txt
      fi
   fi
}
show_pre_help (){
clear
echo "                     =====================================
                     HTK Pre-Installation Help Information
                     =====================================
                 (Tap the Q key to exit from this help screen.)
 
This file is called the HyPerf Tool Kit or 'HTK'.    
 
 
Here are some thing you might want to do with it right up front...
 
---------------------------------------------------------
Browse the payload for documentation, without installing:
---------------------------------------------------------
 
   bash htk.sh --browse doc
 
 
-----------------------------------------------------------------
Extract Plush (for example) from the payload, without installing:
-----------------------------------------------------------------
 
   bash htk.sh --extract plush
 
 
----------------------------------------------------
As the **root** user, install the HTK to ${IDIR}/:
----------------------------------------------------
 
   bash htk.sh --upg
 
 
-------------------------------------------
Installation of the HTK does the following:
-------------------------------------------
1. Copies this script to $MVL
 
 
2. Then $MVL creates hard links starting with h. n. s. and x. that
   point back to itself.  The script parses itself to create the links.
 
   The links make launching HyPerf functions very easy to do.  For example,
   tapping the **Tab** key after typing 'n.' will show the available commands
   that start with 'n.'.  The same works for tapping Tab after typing 's.'
   'h.' or 'x.'.
 
   This feature makes the HTK a very effective tool from the CLI.
 
 
3. Next, if you do not have a '**'$KEYTYPE'**' key pair already created in
   your  ~/.ssh/,  then the htk.sh script creates you a key pair during the
   install.
 
 
4. The script then extracts an embedded payload from itself here...
   The work directory => $MDIR
   The doc  directory => $DOCDIR
 
 
5. When the payload has been successfully extracted, the htk.sh installer
   then prompts the user to type INSTALL or UPGRADE to copy The Plush Profile
   from the extracted payload location to the /etc directory.
 
   (The Plush Profile is embedded in the payload.)
 
 **You should install Plush UNLESS YOU SPECIFICALLY KNOW YOU DO NOT WANT IT.**
 
   Plush sets up effective bash shell aliases, variables, functions, and tips
   for rapid work.  Many of those elements are designed to work specifically
   with HyPerf.
 
   After installation, you may get additional information about PLUSH by typing
   'plush' at the CLI.  
 
 
6. The installer then parses itself and components from the payload to create
   the following function libraries for your scripting use:
   ------------------------------------------------
   $FDIR/hyperf.fnc
   $FDIR/plush.fnc
   ------------------------------------------------
 
 
7. After the installation (or upgrade) is complete, you can use the '--help'
   option to view specific information about any particular command.  Here are
   a few examples:
   --------------------------------
   Examples:   htk.sh        --help
               n.serial_exec --help
               n.hyper_exec  --help
               etc. 
   --------------------------------
 
 
(Tap the Q key to exit from this help screen.)" |less
}
slprn (){
   GLOBIGNORE=*
   for i in $(cat $MLST);do
      $1
   done
   unset GLOBIGNORE
}
unique_get (){
   $CCMD $USR@$i:"$SRC" $HGDR 2>/dev/null
}
wol (){
   for i in $WRLDZ;do
      for a in $(cat $1);do
         /usr/bin/wol -i $i $a
      done
   done
}
xk_mpty (){
   test "$MNAM" = "htk.sh" && test -z $SRC && SRC=inst
}
hyperf_cluster_control_commands (){
   case $MNAM in
      h.attach_to_screens)
         attach_to_screens
      ;;
      h.copy_ids)
         noisy_mode_loop_run copy_ids
      ;;
      n.hyper_deploy)
         noisy_mode_loop_run hyper_deploy
      ;;
      n.hyper_exec)
         noisy_mode_loop_run hyper_exec
      ;;
      n.hyper_get)
         FNM=$(basename $SRC)
         mkdir $HGDR
         noisy_mode_loop_run hyper_get
      ;;
      n.hyper_sync)
         noisy_mode_loop_run hyper_sync
      ;;
      h.id_flush)
         clear
         echo "Deletes $USR ssh keys from $MLST."
         echo "Type EXCT to continue."
         read EXCT
         case $EXCT in
            EXCT)
               noisy_mode_loop_run id_flush
            ;;
            *)
               echo "exiting..."
               exit
            ;;
         esac
      ;;
      h.key_parallel_copy)
         SCREENCOUNT=0
         noisy_mode_loop_run key_parallel_copy
         SCREENCOUNT=0
         key_open_screens
      ;;
      h.populate_known_hosts)
         pop_kwn_hst
      ;;
      h.populate_known_hosts_slow)
         pop_kwn_hst $SRC
      ;;
      n.serial_deploy)
         noisy_mode_loop_run serial_deploy
      ;;
      n.tab_exec)
         table_mode_loop_run serial_exec
      ;;
      n.serial_exec)
         noisy_mode_loop_run serial_exec
      ;;
      n.serial_get)
         FNM=$(basename $SRC)
         mkdir $HGDR
         noisy_mode_loop_run serial_get
      ;;
      n.serial_sync)
         noisy_mode_loop_run serial_sync
      ;;
      n.remote_exec)
         noisy_mode_loop_run remote_exec
      ;;
      h.scan_lan)
         scn_ln
      ;;
      n.unique_get)
         mkdir $HGDR
         noisy_mode_loop_run unique_get
      ;;
      h.wol)
         wol $SRC
      ;;
      h.xosview)
         xovmon
      ;;
      htk.sh)
         case $CMD_LN in
            *)
               htk_install
            ;;
         esac
      ;;
      s.copy_ids)
         slprn copy_ids
      ;;
      s.hyper_deploy)
         slprn hyper_deploy
      ;;
      s.hyper_exec)
         slprn hyper_exec
      ;;
      s.hyper_get)
         FNM=$(basename $SRC)
         mkdir $HGDR
         slprn hyper_get
      ;;
      s.hyper_sync)
         slprn hyper_sync
      ;;
      s.serial_deploy)
         slprn serial_deploy
      ;;
      s.serial_exec)
         slprn serial_exec
      ;;
      s.serial_get)
         FNM=$(basename $SRC)
         mkdir $HGDR
         slprn serial_get
      ;;
      s.serial_sync)
         noisy_mode_loop_run serial_sync
      ;;
      s.remote_exec)
         slprn remote_exec
      ;;
      s.unique_get)
         mkdir $HGDR
         slprn unique_get
      ;;
      x.serial_exec)
         TCMD="$TCMD -X"
         noisy_mode_loop_run serial_exec
      ;;
      x.hyper_exec)
         TCMD="$TCMD -X"
         noisy_mode_loop_run hyper_exec
      ;;
      x.remote_exec)
         TCMD="$TCMD -X"
         noisy_mode_loop_run remote_exec
      ;;
      *)
         echo nothing to do     exiting ...
      ;;
   esac
}
xlprn (){
   GLOBIGNORE=*
   GEOX=0
   GEOY=0
   for i in $(cat $MLST);do
      echo $i
      $1
      GEOX=$(($GEOX+100))
      GEOY=$(($GEOY+100))
   done
   unset GLOBIGNORE
}
xovcmdz (){
   screen -S $i -d -m $XCMD $i xosview -geometry +$GEOX+$GEOY
}
xovmon (){
   clear
   echo "   ======="
   echo "   WARNING"
   echo "   ======="
   echo
   echo "   xosview IS RAM-INTENSIVE ON THIS MACHINE!"
   echo
   echo "Are you sure you want to run it on EVERY MACHINE IN THE LIST? [y/n]"
   echo
   echo -n "[n]  "
   THSBL=n
   read THSBL
   cON
   case $THSBL in 
      y*|sure|ok|do\ it*|go*) xlprn xovcmdz ;;
      *) exit ;;
   esac
   cOFF
}
x_p_cmd (){
   screen -S $i -d -m $XCMD $i $CMD_LN -geometry +$GEOX+$GEOY
}
yolk_2_stdout (){
   # Extracts a yolkified payload from another file
   # Takes 2 args:      1 is unique yolk (payload) name suffix
   #                    2 is name of file to extract yolk from
   if [ $# -ne 2 ] ; then
      echo "Wrong number of arguments."
      echo "You must provide a yolk suffix name and file to extract from."
      return 33
   fi
   tail -n+$(($(grep -no "^#BEGIN_YOLK_${1}" $2 | cut -d":" -f1)+1)) $2 | \
      head -n-1 | openssl base64 -d
}

#main---------------------------------------------------------------------------
defcon htk.conf $@
process_htk_mgmt_options $@
xk_mpty
# NOTE: The script exits prior to the Cluster Control Commands if a management
#       option was given before it makes it to this point.
hyperf_cluster_control_commands
exit

